import React from 'react'

import News from '../myComponent/News'
import { BrowserRouter, Routes as Router, Route } from "react-router-dom";


const Routes = () => {
    const routes=[
        {
            id:1,
            name:'home',
            path:'/',
            component:<News size={6} country="in" category="general" />

        },
        {
            id:2,
            name:'entertainment',
            path:'/castify/entertainment',
            component: <News size={6} country="in" category="entertainment" />

        },
        {
            id:3,
            name:'business',
            path:'/castify/business',
            component: <News size={6} country="in" category="business" />

        }
        ,
        {
            id:4,
            name:'health',
            path:'/castify/health',
            component: <News size={6} country="in" category="health" />

        }
        ,
        {
            id:5,
            name:'science',
            path:'/castify/science',
            component: <News size={6} country="in" category="science" />

        }
        ,
        {
            id:6,
            name:'sports',
            path:'/castify/sports',
            component: <News size={6} country="in" category="sports" />

        },
        {
            id:7,
            name:'technology',
            path:'/castify/technology',
            component: <News size={6} country="in" category="technology" />

        }
    ]
  return (
    <BrowserRouter>
       <Router>
        {
           routes.map(({id,name,path,component})=>{
            return  <Route key={id} path={path} element={{component}}/>
           })
        }
        </Router>
    </BrowserRouter>
  )
}

export default Routes
